import { Route, Switch } from "react-router-dom";
import AlllQuotes from "./pages/allQuotes";
import QuoteDetail from "./pages/QuoteDetail";

function App() {
  return (
    <Switch>
      <Route path={"/quotes"}>
        <AlllQuotes />
      </Route>
      <Route path={"/quotes/:quoteId"}>
        <QuoteDetail />
      </Route>
      <Route path={"/new-quote"}></Route>
    </Switch>
  );
}

export default App;
